import React from "react";

const Menu = () => {
    return (
        <>
            <NavLink exact to="./contact">Contact</NavLink>
            <NavLink exact to="./service">Service</NavLink>
            <NavLink exact to="./about">About</NavLink>
        </>
    );
}

export default Menu;
